import { useNavigate } from "react-router-dom";
import { useState } from "react";

export default function Home() {
  const navigate = useNavigate();
  const [city, setCity] = useState("");

  const handleSearchClick = () => {
    if (city) {
      navigate(`/hotels/${city}`);
    } else {
      alert("Please select a city.");
    }
  };

  return (
    <div className="min-h-screen flex flex-col">
      {/* Navbar */}
      <header className="flex justify-between items-center bg-blue-900 px-8 py-4 text-white">
        <h1 className="text-2xl font-bold">Hotel Booking</h1>
        <div className="flex gap-6">
          <button onClick={() => navigate("/login")} className="hover:underline">Login</button>
          <button onClick={() => navigate("/register")} className="hover:underline">Register</button>
          <button onClick={() => navigate("/about")} className="hover:underline">About</button>
        </div>
      </header>

      {/* Hero Section */}
      <div className="relative h-[600px] bg-cover bg-center flex flex-col items-center justify-center text-white text-center" style={{ backgroundImage: "url('https://images.unsplash.com/photo-1600585154340-be6161a56a0c?auto=format&fit=crop&w=1600&h=600&q=80')" }}>
        <div className="bg-black bg-opacity-50 absolute inset-0" />
        <div className="relative z-10 flex flex-col items-center">
          <h2 className="text-4xl font-bold mb-3">Search hotels in your destination</h2>
          <p className="mb-6">Enter your dates to see the best prices and hotel deals</p>

          <div className="bg-white p-4 rounded-lg flex flex-wrap gap-4 justify-center max-w-3xl shadow-lg">
            <select className="border p-2 rounded w-48" value={city} onChange={(e) => setCity(e.target.value)}>
              <option value="">Where to go?</option>
              <option value="Hyderabad">Hyderabad</option>
              <option value="Vijayawada">Vijayawada</option>
              <option value="Vizag">Vizag</option>
            </select>
            <input type="date" className="border p-2 rounded w-48" />
            <input type="date" className="border p-2 rounded w-48" />
            <select className="border p-2 rounded w-48">
              <option>2 adults · 0 children · 1 room</option>
              <option>1 adult · 0 children · 1 room</option>
              <option>3 adults · 1 child · 2 rooms</option>
            </select>
            <button onClick={handleSearchClick} className="bg-blue-600 text-white px-6 py-2 rounded font-semibold hover:bg-blue-700">Search</button>
          </div>
        </div>
      </div>

      {/* Explore Cities */}
      <section className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 p-8 bg-white">
        {[
          { city: "Hyderabad", img: "https://wallpaperaccess.com/full/2142440.jpg" },
          { city: "Vijayawada", img: "https://wallpaperaccess.com/full/1992125.jpg" },
          { city: "Vizag", img: "https://wallpapercave.com/wp/wp11030879.jpg" }
        ].map(place => (
          <div key={place.city} className="bg-gray-100 rounded-lg shadow-lg hover:scale-105 transform transition cursor-pointer overflow-hidden">
            <img src={place.img} alt={place.city} className="w-full h-48 object-cover" />
            <button onClick={() => navigate(`/hotels/${place.city}`)} className="block w-full text-center bg-blue-900 text-white py-3 font-bold">Explore Hotels in {place.city}</button>
          </div>
        ))}
      </section>

      {/* Footer */}
      <footer className="bg-blue-900 text-white text-center py-4 mt-auto">
        &copy; 2025 Hotel Booking System. All rights reserved.
      </footer>
    </div>
  );
}
